import * as React from 'react';
import TextareaAutosize from '@mui/material/TextareaAutosize';

export default function EmptyTextarea() {
    const mystyle = {
        width: 450 ,
        height:100,
        border:"1 solid black",
        borderRadius: 20
      };
  return (
    <TextareaAutosize
      aria-label="empty textarea"
      placeholder="Empty"
      style={ mystyle}
    />
  );
}
